import React from "react"
import Menu from "./components/Menu";
import Navbar from "./components/Navbar"
import Card from "./components/Card"
import data from "./data"

function App() {
  const cards = data.map(item => {
    return (
        <Card
            key={item.id}
            {...item}

        />
    )
}) 

  return (
    <div>
        <Navbar />
        {/* <Menu /> */}
        <section className="cards-list">
                {cards}
        </section>

    </div>
    )   
}

export default App;
